  `PCLimit` int(11) DEFAULT NULL,
  `Tel` varchar(100) DEFAULT NULL,
  `Qq` varchar(100) DEFAULT NULL,
  `Fax` varchar(20) DEFAULT NULL,
  `Email` varchar(100) DEFAULT NULL,
  `IsTop10` bit(1) NOT NULL DEFAULT b'0',
