  `weixinImg` varchar(100) DEFAULT NULL,
  `weibo` varchar(100) DEFAULT NULL COMMENT 'weibo',
  `weiboImg` varchar(100) DEFAULT NULL,
  `weiboUrl` varchar(100) DEFAULT NULL,
  `Content` text,
  `Websit` varchar(11) DEFAULT NULL,
  PRIMARY KEY (`Id`),
  KEY `FK_Brand_IndustryID` (`IndustryID`),
  KEY `FK_Brand_CreatorUserID` (`CreatorUserID`),
  KEY `FK_Brand_AdminUserID` (`AdminUserID`),
  CONSTRAINT `FK_Brand_AdminUserID` FOREIGN KEY (`AdminUserID`) REFERENCES `users` (`Id`),
  CONSTRAINT `FK_Brand_CreatorUserID` FOREIGN KEY (`CreatorUserID`) REFERENCES `users` (`Id`),
  CONSTRAINT `FK_Brand_IndustryID` FOREIGN KEY (`IndustryID`) REFERENCES `industry` (`Id`)
